  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  was written to guide management on Malheur Wildlife Refuge for the next 15 years.
  This plan outlines the Refuge vision and purpose and describes how the Complex will
  contribute to the overall mission of the Refuge System. The plan provides an introduction
  to the Refuge, an overview of the CCP process, Refuge facilities and public use
  programs, a summary of Refuge resources, goals and objectives, and information about
  the management direction.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
